import React from 'react';

class Home extends React.Component {
  render() {
    const containerStyle = {
      position: 'relative',
      textAlign: 'center',
      color: 'white',
    };

    const centeredStyle = {
      position: 'absolute',
      top: '50%',
      left: '50%',
      transform: 'translate(-50%, -50%)',
    };

    const imageSrc = 'https://d3qyu496o2hwvq.cloudfront.net/wp-content/uploads/2022/08/DDP_2445-565x475.jpg';

    return (
      <div className="container mt-5" style={containerStyle}>
        <img src={imageSrc} alt="Snow" style={{ width: '100%' }} />
        <div className="centered" style={centeredStyle}>
          Centered
        </div>
      </div>
    );
  }
}

export default Home;
